# Fonction pour transformer les données en instructions SQL INSERT INTO
def transformer_en_instructions_sql(donnees):
    instructions_sql = []
    for item in donnees:
        if "Coordonnées non trouvées." not in item:
            station_info = item.split(': ')
            nom = station_info[0]
            latitude, longitude = station_info[1].split(', ')
            latitude = float(latitude.split(' = ')[1])
            longitude = float(longitude.split(' = ')[1])
            instructions_sql.append(f"INSERT INTO stop_loc VALUES ('{nom}', {latitude}, {longitude});")
        else:
            nom = item.split(': ')[0]
            instructions_sql.append(f"INSERT INTO stop_loc VALUES ('{nom}', {float('inf')}, {float('inf')});")
    return instructions_sql

